Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val onsiteAttributedData = spark.sparkContext.textFile("onsite_attributed_data.txt")
      .map(line => {
        val fields = line.split(",")
        (fields(0), fields(1).toLong)
      })

    val topFrequentQueries = spark.sparkContext.textFile("top_frequent_queries.txt")
      .map(line => line.split(",")(0))
      .collect()
      .toSet

    val topFrequentQueriesBroadcast = spark.sparkContext.broadcast(topFrequentQueries)

    val cache = mutable.Map[String, (Long, Long)]()

    val hitRate = onsiteAttributedData.mapPartitions(iter => {
      val cacheMap = cache.synchronized
      val topFrequentQueriesSet = topFrequentQueriesBroadcast.value
      val currentTime = System.currentTimeMillis()
      val hitRateList = new ListBuffer[(String, Int)]()

      iter.foreach { case (query, timestamp) =>
        if (topFrequentQueriesSet.contains(query)) {
          val cacheEntry = cacheMap.get(query)
          if (cacheEntry.isEmpty || (currentTime - cacheEntry.get._1) > 12 * 60 * 60 * 1000) {
            // Cache miss
            cacheMap.put(query, (currentTime, timestamp))
            hitRateList.append((query, 0))
          } else {
            // Cache hit
            hitRateList.append((query, 1))
          }
        }
      }

      hitRateList.iterator
    }).reduceByKey(_ + _)
      .mapValues(hits => hits.toDouble / (hits + misses))
      .collect()

    hitRate.foreach(println)

    spark.stop()
  }
}
```
This job reads the onsite attributed data and top frequent queries from text files, and broadcasts the top frequent queries to all executors. It then initializes an empty cache map to store the queries and their cache timestamps.

The job then processes the onsite attributed data in parallel using the `mapPartitions` transformation. For each query in the data, it checks if it is in the top frequent queries set. If it is, it checks if the query is in the cache map and if the cache entry is still valid (i.e., within the 12-hour window). If the query is not in the cache or the cache entry is expired, it is a cache miss and the query is added to the cache map with the current time and the query timestamp. If the query is in the cache and the cache entry is still valid, it is a cache hit.

The job then calculates the hit rate for each query by dividing the number of hits by the total number of hits and misses. The hit rate is then collected and printed to the console.

