```jsx
import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

const MyForm = () => {
  const [formState, setFormState] = useState({
    name: '',
    email: '',
    message: '',
  });

  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      const { data } = await addData({ variables: { ...formState } });
      console.log('Data submitted successfully:', data);
      // Handle successful submission, e.g. clear form fields
      setFormState({ name: '', email: '', message: '' });
    } catch (error) {
      console.error('Error submitting data:', error);
      // Handle error, e.g. show error message to user
    }
  };

  return (
    <form onSubmit={onSubmit}>
      <label>
        Name:
        <input
          type="text"
          value={formState.name}
          onChange={(event) =>
            setFormState({ ...formState, name: event.target.value })
          }
        />
      </label>
      <label>
        Email:
        <input
          type="email"
          value={formState.email}
          onChange={(event) =>
            setFormState({ ...formState, email: event.target.value })
          }
        />
      </label>
      <label>
        Message:
        <textarea
          value={formState.message}
          onChange={(event) =>
            setFormState({ ...formState, message: event.target.value })
          }
        />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
};

export default MyForm;
```
